description.text:
Friends of mine hosted a Dr Who themed 3D printing / painting class recently and everyone wanted to make a sonic driver and they asked for my 3d printing services.  
While each seasons driver is unique, I thought it'd be extra cool if you could somehow build your own. I eventually thought &quot;why not mix and match pieces from existing drivers to build your own.&quot; Now, you can!  
Introducing thingiverse to the &quot;Dr. Who Sonic Driver Builder Kit&quot;
